@meagandoesstuff At this time we cannot support any WestJet Vacation bookings or inquires through this chat forum. Please call WestJet Vacations at 1-877-737-7001. The hours of operation are:
Monday – Friday: 6 a.m. to 10 p.m. MT
Saturday – Sunday: 6 a.m. to 6 p.m. MT

@RU_2011 For out-of-pocket expenses for a delay or cancellation within our control, you can submit a request to WestJet for possible reimbursement.
To submit your itemized receipts for review, please click here: https://t.co/LQPuPt2Wia.
It will be reviewed to determine eligibility.

@RU_2011 You're welcome to reply to the email you received about your claim.
If you would like a further inquiry into this result, we kindly ask that you contact the Canadian Transportation Agency (CTA).
Thank you for your understanding.

@AudheshD Hello, Thank you for connecting with us. If you could please send us the following information, we would be happy to take a look:  full name-six letter reservation code, email address, 
Please reply direct message to ensure your privacy
 ~Dave

